import React, { Component, useState } from "react";
import { StyleSheet, View, TouchableOpacity, Text } from "react-native";
import FieldInputWithLabel from "./FieldInputWithLabel";
import GooglePlacesAutocomplete from "react-google-places-autocomplete";
import {
  CardElement,
  Elements,
  useElements,
  useStripe,
} from "@stripe/react-stripe-js";
import { loadStripe } from "@stripe/stripe-js";
const GOOGLE_API_KEY = "AIzaSyDjx4LBIEDNRYKEt-0_TJ6jUcst4a2YON4";

function CheckOutDetails({
  storeDetails,
  setorderDetails,
  orderDetails,
  setpage,
}) {
  const [emailAddress, setemailAddress] = useState('');
  const [nameOnCard, setnameOnCard] = useState('');
  const [cardNumber, setcardNumber] = useState('')
  const [expiry, setexpiry] = useState('');
  const [cvv, setcvv] = useState('');

  const stripe = useStripe();
  const elements = useElements();

  const [currency, setCurrency] = useState("cad"); // Default to CAD

  const handleSubmit = async (event) => {
    event.preventDefault();

    if (!stripe || !elements) {
      // Stripe.js has not loaded yet.
      return;
    }

    const cardElement = elements.getElement(
      <CardElement options={{ hidePostalCode: true }} />
    );

    const { token, error } = await stripe.createToken(cardElement);

    if (error) {
      console.error("Error creating token:", error);
    } else {
      console.log("Token:", token);

      // Send the token, amount, and currency to your Firebase Function to process the payment
      const response = await fetch(
        "https://us-central1-posmate-5fc0a.cloudfunctions.net/processPayment",
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            token: token.id,
            amount: orderDetails.total,
            currency,
            storeUID: storeDetails.docID,
            orderDetails: orderDetails,
          }),
        }
      );

      try {
        const responseData = await response.json();

        if (response.ok && responseData.success) {
          console.log("Payment processed successfully!");
          setpage(4);
        } else {
          console.error(
            "Payment processing failed. Server message:",
            responseData.message
          );
        }
      } catch (jsonError) {
        console.error("Error parsing JSON response:", jsonError);
      }
    }
  };

  return (
    <Elements stripe={loadStripe(storeDetails.stripePublicKey)}>
      <View style={styles.fieldsGroup}>
        <FieldInputWithLabel
          txtInput="Email Address"
          label="Email Address*"
          style={styles.nameField}
          value={emailAddress}
          onChangeText={(text) =>
            setemailAddress(tex)
          }
        />
        <FieldInputWithLabel
          txtInput="Name On Card"
          label="Name On Card*"
          style={styles.nameField}
          value={nameOnCard}
          onChangeText={(text) =>
            setnameOnCard(text)
          }
        ></FieldInputWithLabel>
        <FieldInputWithLabel
          txtInput="1234 1234 1234 1234"
          label="Card Number*"
          style={styles.nameField}
          value={orderDetails.customer.phoneNumber}
          onChangeText={(text) =>
            setorderDetails({
              ...orderDetails,
              customer: { ...orderDetails.customer, phoneNumber: text },
            })
          }
        ></FieldInputWithLabel>
        <View style={styles.buzzCodeAndPhoneRow}>
          <FieldInputWithLabel
            txtInput="MM/YY"
            label="Expiry*"
            style={styles.buzzCodeField}
            value={orderDetails.customer.buzzCode}
            onChangeText={(text) =>
              setorderDetails({
                ...orderDetails,
                customer: { ...orderDetails.customer, buzzCode: text },
              })
            }
          ></FieldInputWithLabel>
          <FieldInputWithLabel
            txtInput="123"
            label="CVV*"
            style={styles.phoneNumberField}
            value={orderDetails.customer.unitNumber}
            onChangeText={(text) =>
              setorderDetails({
                ...orderDetails,
                customer: { ...orderDetails.customer, unitNumber: text },
              })
            }
          ></FieldInputWithLabel>
        </View>
      </View>
      <TouchableOpacity
        style={styles.continueBtn}
        onPress={handleSubmit}
        disabled={!stripe}
      >
        <Text style={styles.continueBtnTxt}>CHECKOUT</Text>
      </TouchableOpacity>
    </Elements>
  );
}

const styles = StyleSheet.create({
  container: {
    width: 380,
    height: 390,
  },
  fieldsGroup: {
    width: 380,
    height: 325,
    justifyContent: "space-between",
  },
  nameField: {
    height: 70,
    width: 380,
  },
  addressField: {
    height: 70,
    width: 380,
  },
  buzzCodeAndPhoneRow: {
    width: 380,
    height: 70,
    flexDirection: "row",
    justifyContent: "space-between",
  },
  buzzCodeField: {
    height: 70,
    width: 175,
  },
  phoneNumberField: {
    height: 70,
    width: 175,
  },
  continueBtn: {
    width: 219,
    height: 60,
    backgroundColor: "rgba(238,125,67,1)",
    borderRadius: 60,
    justifyContent: "center",
    alignItems: "center",
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 30,
    shadowOpacity: 0.2,
    shadowRadius: 10,
  },
  continueBtnTxt: {
    color: "rgba(255,255,255,1)",
    fontSize: 18,
    fontWeight: "700",
  },
});

export default CheckOutDetails;
